import { useEffect, useState } from "react";
import api from "../api";
import "./Projects.css";

const BACKEND_URL = "http://localhost:5000";

export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [showDetails, setShowDetails] = useState(null);

  /* ================= FETCH PROJECTS ================= */
  const fetchProjects = async () => {
    try {
      const res = await api.get("/lily");
      setProjects(res.data.data || []);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchProjects();
  }, []);

  return (
    <div className="projects-page">
      <h2>Projects</h2>

      {/* ================= TABLE ================= */}
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Type</th>
            <th>Location</th>
            <th>Images / Floor Plans</th>
            <th>Action</th>
          </tr>
        </thead>

        <tbody>
          {projects.map((p, i) => (
            <tr key={p.id}>
              <td>{i + 1}</td>
              <td>{p.projectName}</td>
              <td>{p.projectType}</td>
              <td>{p.location}</td>

              {/* ===== IMAGE PREVIEW ===== */}
              <td>
                {(p.images || []).slice(0, 2).map((img, idx) => (
                  <img
                    key={idx}
                    src={`${BACKEND_URL}${img.url}`}
                    alt="project"
                    className="thumb"
                    onClick={() => setShowDetails(p)}
                  />
                ))}

                {(p.floorPlans || []).slice(0, 2).map((fp, idx) => (
                  <img
                    key={idx}
                    src={`${BACKEND_URL}${fp.url}`}
                    alt="floorplan"
                    className="thumb"
                    onClick={() => setShowDetails(p)}
                  />
                ))}
              </td>

              <td>
                <button onClick={() => setShowDetails(p)}>
                  View Details
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* ================= MODAL ================= */}
      {showDetails && (
        <div className="modal">
          <div className="modal-content">
            <h2>{showDetails.projectName}</h2>
            <p><b>Type:</b> {showDetails.projectType}</p>
            <p><b>Location:</b> {showDetails.location}</p>

            <p>
              <b>Geo:</b>{" "}
              {showDetails.geoLocation?.coordinates
                ? `${showDetails.geoLocation.coordinates[1]}, ${showDetails.geoLocation.coordinates[0]}`
                : "-"}
            </p>

            <p>
              <b>Amenities:</b>{" "}
              {(showDetails.amenities || []).join(", ")}
            </p>

            {/* ===== PROJECT IMAGES ===== */}
            <h4>Project Images</h4>
            <div className="image-grid">
              {(showDetails.images || []).map((img, idx) => (
                <img
                  key={idx}
                  src={`${BACKEND_URL}${img.url}`}
                  alt="project"
                />
              ))}
            </div>

            {/* ===== FLOOR PLANS ===== */}
            <h4>Floor Plans</h4>
            <div className="image-grid">
              {(showDetails.floorPlans || []).map((fp, idx) => (
                <img
                  key={idx}
                  src={`${BACKEND_URL}${fp.url}`}
                  alt="floorplan"
                />
              ))}
            </div>

            <button className="btn-close" onClick={() => setShowDetails(null)}>
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
